import React, { Component } from 'react';
import { variables } from './Variables.js';

export class Home extends Component {
    constructor(props) {
        super(props);

        this.state = {
            PhotoPath: variables.PHOTO_URL
        }
    }

    render() {
        const {
            PhotoPath,
        } = this.state;
        return (
            <div>
                <br />
                <h3>Acerca del Desarrollador</h3>
                <hr />
                <div>
                    <br />
                    <h3 align="center" >Manuel Eduardo Rivera Argueta</h3>
                    <img width="340px" height="390px" align="left" src={PhotoPath + 'Many_formal.jfif'} />
                
                </div>
                
            </div>
        )
    }
}
